// SPDX-License-Identifier: MIT
pragma solidity 0.8.9;

interface IERC20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

abstract contract Context{
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    constructor() {
        _setOwner(_msgSender());
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    modifier onlyOwner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }
    function renounceOwnership() public virtual onlyOwner {
        _setOwner(address(0));
    }
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _setOwner(newOwner);
    }
    function _setOwner(address newOwner) private {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

contract MarvinV2Swap is Context, Ownable {

    IERC20 private marvinV1;
    IERC20 private marvinV2;

    uint256 private swapCount = 0;

    constructor(address v1Token, address v2Token){
        marvinV1 = IERC20(v1Token);
        marvinV2 = IERC20(v2Token);
    } 

    function marvinV1Token() external view returns(IERC20){
        return marvinV1;
    }

    function marvinV2Token() external view returns(IERC20){
        return marvinV2;
    }

    function balanceOfV1() public view returns(uint256){
        return marvinV1.balanceOf(address(this));
    }

    function balanceOfV2() public view returns(uint256){
        return marvinV2.balanceOf(address(this));
    }

    function totalSwapCount() external view returns(uint256) {
        return swapCount;
    }

    
    function withdrawMarvinV1() external onlyOwner() returns(bool){
        marvinV1.transfer(owner(), balanceOfV1());
        return true;
    }

    function withdrawMarvinV2() external onlyOwner() returns(bool){
         marvinV2.transfer(owner(), balanceOfV2());
         return true;
    }

    function swapV1forV2() external returns(bool){

        uint256 swapAmount = marvinV1.balanceOf(_msgSender());
        //deposit marvin V1
        marvinV1.transferFrom(_msgSender(), address(this), swapAmount);
        //release marvin V2
        marvinV2.transfer(_msgSender(), swapAmount);
        swapCount +=1;
        return true;
    }
}
